import React from 'react'
import 'HeaderCard.css'

function HeaderCard() {
    return (
        <div className='Header-card'>
          <img src="../src/images/profile.png" alt='profile-pic'></img>
          <h3>My Coding Profiles</h3>
        </div>
      )
}

export default HeaderCard
